import React from 'react'; 
import { Container, Row, Col } from 'reactstrap';
import "./HeaderSection.css"; 

const HeaderSection = props => {
 return (
   <Container fluid className="px-0 header-section">
      <Row>
        <Col xs={12} md={8}>
          <h1>Hello </h1> 
        </Col>
        <Col xs={12} md={4}>
        </Col>
      </Row>
      <h1></h1>


   </Container>
 );
} 

export default HeaderSection;
